window.bookSummaryJSON = "<p>In the near future where printing a brain is only a click away, the city of Portland, Oregon thrives as the new metropolis of high tech. It also boasts the highest abduction rate in the world and a dark op agency suspects its Forest Park is the major scene of intergalactic crimes. But when those responsible fail to take credit for the missing, the covert agency calls upon the clone of legendary FBI Agent Caitlin Diggs to assist in hunting down the invisible enemy. Equipped with psi abilities, the dark agency hopes Diggs can stop the enemy without exposing an alien threat to the populace.</p> <p>Just underneath the radar, aliens walk in Portland under the guise of humans thanks to a morphic shaping technology. An alien posing as Wondertech’s top acquisitions specialist, Krista Shay, is hoping to find a peaceful way to initiate a first contact. Yet those back on the Zyri home world seem to have a different agenda for the planet Earth and it has nothing to do with extending an olive branch. The real Krista Shay is trapped in an alien body on Zyri and learns the sinister plans of a man she calls the Interrogator will only thwart a peace initiative.</p> <p>Can Agent Diggs and the peace loving alien posing as Krista Shay find a way to unravel the dark mystery of the forest and take down the invisible enemy before an interplanetary war erupts?</p>"; 
